    "# Histogramas\n",
    "datasetOriginalNumberColumns = datasetOriginal.select_dtypes(include=[numpy.number])\n",
    "datasetOriginalNumberColumns.info()\n",
    "\n",
    "pyplot.figure(figsize=(15,10))\n",
